import React from "react";
import { NavLink } from 'react-router-dom';

const Mainpage = () => {
    return <section class="text-gray-600 body-font">
    <div class="container mx-auto flex px-5 py-24 items-center justify-center flex-col">
      <div class="text-center lg:w-2/3 w-full">
        <h1 class="title-font sm:text-4xl text-3xl mb-4 font-medium text-gray-900">Клининг сервис</h1>
        <p class="mb-8 leading-relaxed text-lg">Мы - профессиональная команда, которая предлагает полный спектр услуг по уборке. Мы используем экологически чистые средства и оборудование, чтобы достичь оптимального результата. Наша команда состоит из ответственных профессионалов, готовых выслушать ваши пожелания и запросы. Мы стремимся к постоянному улучшению нашей работы и всегда готовы оправдать доверие наших клиентов. Обращайтесь к нам сегодня, чтобы получить бесплатную консультацию и оценку стоимости наших услуг.</p>
        <div class="flex justify-center">
        <NavLink to="/s" class="block py-2 pl-3 pr-4 ml-16 text-gray-900 rounded hover:bg-gray-100 md:hover:bg-transparent md:border-0 md:hover:text-blue-700 md:p-0 dark:text-white md:dark:hover:text-blue-500 dark:hover:bg-gray-700 dark:hover:text-white md:dark:hover:bg-transparent">Войти</NavLink>
        </div>
      </div>
    </div>
  </section>
}

export default Mainpage;
